import React from 'react';


function ListPost() {

    return (
                <div class="card col-5">
                    <div class="card-header colorAutor"> 
                        Autor: 
                    </div>
                    <div class="card-body">
                        <label class="form-label" id="title">Título: </label>
                        <input id="title" type="text" class="form-control"/>
                        <label class="form-label" id="message">Mensaje: </label>
                        <input id="message" type="text" class="form-control" placeholder="Tu texto..."/>
                        <button type="submit" className="btn btn-primary">Nuevo post</button>
                    </div>
                </div>
    );
};

export default ListPost;
